import React from "react";
import Table_column_child from "./Table_column_child";

function Table_flesh(props){
    console.log("Table_flesh")

    return(
    <div  className={`${props.classN}`} >
        <Table_column_child 
            p_yakliki={props.p_yakliki} 
            s_yakliki={props.s_yakliki} 
            calcule={props.calcule} 
            num={props.num} 
            boy_p={props.boy_p} 
            boy_s={props.boy_s} 
            table_column_children={props.table_column_children} 
        />
        <Table_column_child 
            p_yakliki={props.p_yakliki} 
            s_yakliki={props.s_yakliki} 
            calcule={props.calcule} 
            num={props.num+1} 
            boy_p={props.boy_p} 
            boy_s={props.boy_s} 
            table_column_children={props.table_column_children} 
        /> 
        <Table_column_child 
        p_yakliki={props.p_yakliki} 
        s_yakliki={props.s_yakliki} 
        calcule={props.calcule} 
        num={props.num+1} 
        boy_p={props.boy_p} 
        boy_s={props.boy_s} 
        table_column_children={props.table_column_children} 
    /> 
    <Table_column_child 
    p_yakliki={props.p_yakliki} 
    s_yakliki={props.s_yakliki} 
    calcule={props.calcule} 
    num={props.num+1} 
    boy_p={props.boy_p} 
    boy_s={props.boy_s} 
    table_column_children={props.table_column_children} 
/> 
<Table_column_child 
p_yakliki={props.p_yakliki} 
s_yakliki={props.s_yakliki} 
calcule={props.calcule} 
num={props.num+1} 
boy_p={props.boy_p} 
boy_s={props.boy_s} 
table_column_children={props.table_column_children} 
/> 
<Table_column_child 
p_yakliki={props.p_yakliki} 
s_yakliki={props.s_yakliki} 
calcule={props.calcule} 
num={props.num+1} 
boy_p={props.boy_p} 
boy_s={props.boy_s} 
table_column_children={props.table_column_children} 
/> 
<Table_column_child 
p_yakliki={props.p_yakliki} 
s_yakliki={props.s_yakliki} 
calcule={props.calcule} 
num={props.num+1} 
boy_p={props.boy_p} 
boy_s={props.boy_s} 
table_column_children={props.table_column_children} 
/> 

        
        
       
    </div>
    )
}

export default React.memo(Table_flesh) ;
